import { Button, StyleSheet } from 'react-native';

const Top = ({ navigation }) => {
  return (
    <Button
      title="Go to Dashboard"
      onPress={() =>
        navigation.navigate('Dashboard')
      }
    />
  )
}

const styles = StyleSheet.create({
    buttonTop: {
        backgroundColor: 'red',
    }
});

export default Top
